    "    ax2.set_title('Percentage Contribution to Total Gas Consumption DN')\n",
    "    ax2.set_xlabel('DN')\n",
    "    ax2.set_ylabel('Percentage (%)')\n",
    "    ax2.tick_params(axis='x', rotation=45)\n",
    "    \n",
    "    # Add percentage labels on bars\n",
